import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M2 6a1 1 0 011-1h15a1 1 0 110 2H3a1 1 0 01-1-1z", fill: primaryFill }),
        React.createElement("path", { d: "M2 18a1 1 0 011-1h11a1 1 0 110 2H3a1 1 0 01-1-1z", fill: primaryFill }),
        React.createElement("path", { d: "M3 11a1 1 0 100 2h18a1 1 0 100-2H3z", fill: primaryFill }));
};
const TextAlignLeft24Filled = wrapIcon(rawSvg({}), 'TextAlignLeft24Filled');
export default TextAlignLeft24Filled;
